import React from "react";
import {Input,Button} from "react-native-elements";
import Spacer from "./Spacer";

const TrackForm = () => {
    return (
        <>
        <Spacer>
        <Input
        placeholder="Enter Track Name"
        />
        </Spacer>
        <Button
        title="Start Track"
        />
        </>
    );
}

export default TrackForm;
